import React, { Component } from 'react';
//import logo from './logo.svg';
import 'bootswatch/dist/solar/bootstrap.min.css'; 
import './App.css';

function App() {
  return (

    <div className="App">
      {/*
      <header className="App-header">
        This is the Note Frequency Math page

        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Change <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

      </header>
       */}
      <div class="page-header" id="banner">
        <h1>Note Frequency Math</h1>
        <p>Go Nimbly Interview Project by Amy Herz</p>
      </div>
      <div class="jumbotron">
        <div class="form-group">
          <label for="frequencyRange">Frequency Range</label>
          <input type="range" class="custom-range" id="frequencyRange"></input>
          <label class="col-form-label col-form-label-lg" for="freqInput">
            Beginning Frequency (in Hertz)
          </label>
          <input class="form-control form-control-lg" type="text" placeholder="261.6" id="freqInput"></input>
          {/* add in designation underneath this to grab frequency and display note (middle C, C4) */}
          <label class="col-form-label col-form-label-lg" for="userInput">
            User Input
          </label>
          <input class="form-control form-control-lg" type="text" placeholder="1" id="userInput"></input>
          <label class="col-form-label col-form-label-lg" for="resultFrequency">
            Resulting Frequency
          </label>
          <input class="form-control form-control-lg" type="text" placeholder="281.6" id="resultFrequency"></input>
        </div>
      </div>
    </div>
  );
}

class Results extends Component {
  state = {
    calculatedFrequency: []
  }

  componentDidMount() {
    fetch()
    .then(res => res.json())
    .then((data) => {
      this.setState({ calculatedFrequency: data })
    })
    .catch(console.log)
  }
}

export default App;
